import React from 'react';
import { useLocation } from 'react-router-dom';

const Results = () => {
  const { state } = useLocation();

  if (!state || !state.tracks) {
    return <div className="text-center mt-12">No recommendations found. Please try again.</div>;
  }

  const { tracks, mood } = state;

  // Map moods to background gradient classes
  const backgroundClasses = {
    happy: 'bg-gradient-happy',
    relaxed: 'bg-gradient-relaxed',
    energetic: 'bg-gradient-energetic',
    default: 'bg-gradient-default',
  };

  const backgroundClass = backgroundClasses[mood] || backgroundClasses.default;

  // Placeholder for recommendation score logic
  const getRecommendationScore = () => {
    // In a real app, this would be a more complex calculation.
    // For now, we'll generate a score based on the number of tracks.
    return Math.min(8 + Math.random() * 2, 10).toFixed(1);
  };

  return (
    <div className={`min-h-screen p-4 ${backgroundClass}`}>
      <div className="text-center mb-8">
        <h1 className="text-4xl font-bold text-white">Your Recommendations</h1>
        <div className="mt-2 text-lg text-white">
          <span>Recommendation Score: </span>
          <span className="font-bold text-2xl">{getRecommendationScore()}</span>
          <span> / 10</span>
        </div>
      </div>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6 px-4">
        {tracks.map(track => (
          <div key={track.id} className="bg-black bg-opacity-50 p-4 rounded-lg shadow-lg text-white">
            <h2 className="text-lg font-semibold mb-2">{track.name}</h2>
            <iframe
              src={`https://open.spotify.com/embed/track/$${track.id}`}
              title={track.name}
              className="w-full h-20"
              allow="encrypted-media"
            ></iframe>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Results;
